      sanitizedJobDescription:
        "<p><b>Description du poste et Missions<\u002Fb><\u002Fp>\n<p>En tant que Data Engineer, vous serez chargé(e) de proposer les meilleures solutions à l’entreprise en leur permettant d’optimiser leur activité, à travers quelques missions principales :<\u002Fp>\n<ul>\n <li>Développer des solutions pour traiter des volumes importants de données,<\u002Fli>\n <li>Concevoir, collecter et fabriquer des données brutes,<\u002Fli>\n <li>Créer des outils et algorithmes pour le traitement des données,<\u002Fli>\n <li>Préparer des données pour le Data Analyst,<\u002Fli>\n <li>Sécuriser des Pipelines données pour les Data Analysts et Data Scientists,<\u002Fli>\n <li>Organiser l’architecture du cloud,<\u002Fli>\n <li>Contribuer à l’effort d’animation technique, de veille technologique et d’innovation<\u002Fli>\n<\u002Ful>\n<p><b>LES + DE CETTE EXPÉRIENCE :<\u002Fb><\u002Fp>\n<p>Ce parcours vous offre plusieurs avantages :<\u002Fp>\n<ul>\n <li>En plus de vous former, DataScientest organise votre recrutement au sein des plus grands groupes et ESN<\u002Fli>\n <li>Votre formation sera 100% financée et aucun reste à charge ne sera demandé à l’apprenti(e),<\u002Fli>\n <li>Un diplôme ou titre RNCP de niveau Bac +5,<\u002Fli>\n <li>Une préparation optimale au passage des certifications éditeurs : AWS, Azure ou encore GCP En tant que Data Engineer certifié à la suite de votre formation chez DataScientest, vous serez un véritable expert !<\u002Fli>\n<\u002Ful>\n<p><b>Profil recherché<\u002Fb><\u002Fp>\n<ul>\n <li>Vous êtes diplômé d'un bac+3 à bac+5<\u002Fli>\n <li>Issu(e) d’une filière scientifique ou informatique ou d’un diplôme d’ingénieur,<\u002Fli>\n <li>Vous disposez idéalement d’une expérience en développement informatique, en architecture réseaux ou dans la Data,<\u002Fli>\n <li>Vous maîtrisez un langage objet type Java, Python, C++, etc<\u002Fli>\n <li>Vous avez un bon niveau en développement et python<\u002Fli>\n<\u002Ful>\n<p>Type d'emploi : Alternance<br>Statut : Cadre<\u002Fp>\n<p>Rémunération&nbsp;: Jusqu'à 2 000,00€ par mois<\u002Fp>\n<p>Avantages&nbsp;:<\u002Fp>\n<ul>\n <li>Prise en charge du transport quotidien<\u002Fli>\n <li>RTT<\u002Fli>\n<\u002Ful>\n<p>Horaires&nbsp;:<\u002Fp>\n<ul>\n <li>Du lundi au vendredi<\u002Fli>\n <li>Flextime<\u002Fli>\n <li>Travail en journée<\u002Fli>\n<\u002Ful>\n<p>Rémunération supplémentaire&nbsp;:<\u002Fp>\n<ul>\n <li>13ème Mois<\u002Fli>\n <li>Prime annuelle<\u002Fli>\n <li>Primes<\u002Fli>\n<\u002Ful>\n<p>Lieu du poste : Déplacements fréquents<\u002Fp>",
